webpackJsonp([0xc62cc54b1175a800],{"./node_modules/json-loader/index.js!./.cache/json/html-elements-b-tag.json":function(e,t){e.exports={data:{markdownRemark:{html:'<h2>B Tag</h2>\n<p>The <code>&#x3C;b></code> tag is used to make the text placed between the tags as Bold.\nThe <code>&#x3C;b></code> tag represents a span of text.\nIt is stylistically different from normal text. </p>\n<p>Here is an example on how to use them.</p>\n<p><code>&#x3C;b>I am bold text &#x3C;/b></code></p>\n<p>Which results in:</p>\n<p><b>I am bold text</b></p>\n<h3>Note:</h3>\n<p>The text inside a <code>&#x3C;b></code> tag does not convey any importance it is just to make the text bold.\nTo make text bold and convey some importance <code>&#x3C;strong></code> tag is used.\nYou should not use <code>&#x3C;b></code> tag to make Heading bold rather use the Heading tags from <code>&#x3C;h1></code> till <code>&#x3C;h6></code>.</p>\n<h4>More Information:</h4>\n<p>+<a href="https://developer.mozilla.org/tr/docs/Web/HTML/Element/b">MDN</a></p>',fields:{slug:"/html/elements/b-tag/"},frontmatter:{title:"B Tag"}}},pathContext:{slug:"/html/elements/b-tag/"}}}});
